import './App.css';

function App() {
  return (
    <div class="ensemble">
      <div class="table">
            <form id="loginForm">
            <label>email</label>
            <input  type="text" id="email" name="email" required></input>
            <label>Mot de passe</label>
            <input  type="password" id="password" name="password" required></input>

      </form>
</div>

    </div>
  );
}

export default App;
